// NamedAccessPlatforms returns the AccessPlatforms named value or an error if the edge was not
// loaded in eager-loading with this name.
func (_m *IdentityHolder) NamedAccessPlatforms(name string) ([]*Platform, error) {
	if _m.Edges.namedAccessPlatforms == nil {
		return nil, &NotLoadedError{edge: name}
	}
	nodes, ok := _m.Edges.namedAccessPlatforms[name]
	if !ok {
		return nil, &NotLoadedError{edge: name}
	}
	return nodes, nil
}

func (_m *IdentityHolder) appendNamedAccessPlatforms(name string, edges ...*Platform) {
	if _m.Edges.namedAccessPlatforms == nil {
		_m.Edges.namedAccessPlatforms = make(map[string][]*Platform)
	}
	if len(edges) == 0 {
		_m.Edges.namedAccessPlatforms[name] = []*Platform{}
	} else {
		_m.Edges.namedAccessPlatforms[name] = append(_m.Edges.namedAccessPlatforms[name], edges...)
	}
}

// IdentityHolders is a parsable slice of IdentityHolder.
type IdentityHolders []*IdentityHolder
